// SPDX-License-Identifier: MIT
pragma solidity 0.8.17;

// to deploy 
// deployed contract address 
// ABI


contract KanbanContract {
  event AddTask(address receipient, uint taskId);

  event DeleteTask(uint taskId, bool isDeleted);

  event UpdateTask(uint taskId, string title, string  description, uint  dueDate, string  priority, string state);

// {
//       "id": 1,
//       "title": "Task title",
//       "description": "Task description",
//       "dueDate": "2022-08-10",
//       "priority": "HIGH",
//       "state": "TODO",
//       "createUser": "current user"
//     }

  struct Task {
    uint id;
    string title;
    string description;
    uint dueDate; // unix-timestamp
    string priority;
    string taskState;
    string createUser;
    bool isDeleted;
  }

  // to create a new Task
  // Task(1, "task 1", "task 1 description", "1664614481109", "HIGH", "TODO", "jayant", false);

  // private meaning no one outside of this contract can access this variable.
  Task[] private tasks;

  // uint256 => key
  // address => wallet address
  // {0: 0xxwkc..7a}, it is like a mapping table, tasks will be asisgned to owners address
  mapping(uint256 => address) taskToOwner;


  // will not return anything
  function addTask(string memory title, string memory description, uint dueDate, string memory priority, string memory taskState, string memory createUser, bool isDeleted) external {
    uint taskId = tasks.length;
    tasks.push(Task(taskId, title, description, dueDate, priority, taskState, createUser, isDeleted));

    taskToOwner[taskId] = msg.sender; // it will get the wallet address of user who is loggedin

    emit AddTask(msg.sender, taskId);
  }


  function getTasks() external view returns (Task[] memory) {
    Task[] memory temp = new Task[](tasks.length); // length of array = length of tasks variable
    uint counter = 0;

    for(uint i=0; i<tasks.length; i++) {
      if(taskToOwner[i] == msg.sender && tasks[i].isDeleted == false) {
        temp[counter] = tasks[i];
        counter++;
      }
    }
    Task[] memory result = new Task[](counter); 
    for(uint i=0; i<counter; i++) {
      result[i] = temp[i];
    }
    return result;
  }

  function deleteTasks(uint taskId, bool isDeleted) external {
    if(taskToOwner[taskId] == msg.sender) { // is current user is the owner of the task
      tasks[taskId].isDeleted = isDeleted;
      // in blockchain we can't delete anything
      emit DeleteTask(taskId, isDeleted);
    }
  }

  function updateTaskState(uint taskId, string memory taskState) external {
    if(taskToOwner[taskId] == msg.sender) {
      tasks[taskId].taskState = taskState;
    }
  }

  function updateTaskPriority(uint taskId, string memory priority) external {
    if(taskToOwner[taskId] == msg.sender) { 
       tasks[taskId].priority = priority;
    }
  }

  function updateTaskDueDate(uint taskId, uint dueDate) external {
    if(taskToOwner[taskId] == msg.sender) {
      tasks[taskId].dueDate = dueDate;
    }
  }

  function updateTaskFields(uint taskId, string memory title, string memory description, uint  dueDate, string memory priority, string memory taskState) external {
    if(taskToOwner[taskId] == msg.sender) {
      tasks[taskId].title = title;
      tasks[taskId].description = description;
      tasks[taskId].dueDate = dueDate;
      tasks[taskId].priority = priority;
      tasks[taskId].taskState = taskState;

      emit UpdateTask(taskId, title, description, dueDate, priority, taskState);
    }
  }
}
